        return(

        <div>
  <nav class="navbar navbar-dark bg-dark">
    <div class="container-fluid ">
        
    <Link to={Home} className="font-weight-bold text-decoration-none "><h4>omega Hospitals</h4></Link>
    
        <ul class="navbar-nav  mb-2">
          <li class="nav-item">
          <Link to={Ward} className="font-weight-bold text-decoration-none "> wards</Link>
    
          </li>
          <li class="nav-item">
        
          </li>
          <li class="nav-item">
          </li>
        </ul>
       
      
    </div>
  </nav>
  </div>

        )
    
}


export default Nav;
